webpackJsonp([92],{"./node_modules/json-loader/index.js!./.cache/json/articles-sql-sql-create-table-statement.json":function(e,a){e.exports={data:{markdownRemark:{html:'<h2>SQL Create Table Statement</h2>\n<!-- The article goes here, in GitHub-flavored Markdown. Feel free to add YouTube videos, images, and CodePen/JSBin embeds  -->\n<p>A table is a group of data stored in a database.</p>\n<p>To create a table in a database you use the <code>CREATE TABLE</code> statement. You give a name to the table and a list of columns with its datatypes.</p>\n<p>Hereâ€™s an example creating a table named Person:</p>\n<pre><code class="language-sql">CREATE TABLE Person(\n  Id int not null,\n  Name varchar not null,\n  DateOfBirth date not null,\n  Gender bit not null,\n  PRIMARY KEY( Id )\n);\n</code></pre>\n<p>In the example above, each Person has a Name, a Date of Birth and a Gender. The Id column is the key that identifies one person in the table. You use the keyword <code>PRIMARY KEY</code> to configure one or more columns as a primary key.</p>\n<p>A column can be <code>not null</code> or <code>null</code> indicating whether it is mandatory or not.</p>\n<h4>More Information:</h4>\n<!-- Please add any articles you think might be helpful to read before writing the article -->',frontmatter:{title:"SQL Create Table Statement",parent:"/home/stuart/guides/src/pages/articles/sql/sql-create-table-statement/index.md absPath of file"}}},pathContext:{slug:"/articles/sql/sql-create-table-statement/"}}}});
